import{BrowwserRouter,Routes,Route, Router, Link} from 'react-router-dom'
import './App.css';
import About from './Component/About';
import Home from './Component/Home';
import Profil from './Component/Profil';
function App() {
  return (
    <div className="App">
      App Page
      <Router>
        <nav>
        <Link to="/">Home</Link>
        </nav>
        <Routes>
          <Route path="/" element={<Home />}/>
          <Route path="/about" element={<About />}/>
          <Route path="/profil" element={<Profil />}/>
        </Routes>
      </Router>
    </div>
  );
}

export default App;
